#!/usr/bin/env python
# -*- coding: utf-8 -*-

def ingresar_nombre():
    while True:
        nombre = input("Ingrese el nombre del alumno: ")
        if nombre and not nombre.isspace():
            return nombre
        else:
            print("Error: debe ingresar un nombre")

def ingresar_cursos():
    while True:
        cursos = input("Ingrese la cantidad de cursos: ")
        if cursos.isdecimal() and cursos != "0":
            return int(cursos)
        else:
            print("Error: debe ingresar un nro entero positivo")



def imprimir(alumnos):
    if not alumnos:
        print("No hay alumnos")
            
    else:
        print("Lista de alumnos:")
        for k,v in alumnos.items():  
            print(f"{k} - {v} cursos")

    
def menu():
    return """
    Ingrese el número de la operación que desea ejecutar:
    1 - Ingresar un alumno
    2 - Ver lista de alumnos
    3 - Ver cursos de un alumno
    4 - Salir
    """


    
def buscar_cursos():
    nombre = input("Ingrese el nombre del alumno: ")
    if nombre in alumnos.keys():
        return f"Cantidad de cursos: {alumnos[nombre]}"
    else:
        return "Alumno no hallado"



# Estructura de datos: diccionario
# alumnos = {"Juana": 3, "Ana":6, "Jose":8}
alumnos = {}


 
while True:
    print(menu())
 
    opcion = input(">>> ")
 
    if opcion == "1":
        nombre = ingresar_nombre()
        cursos = ingresar_cursos()
        alumnos[nombre] = cursos
        print("¡El alumno fue añadido a la lista!")

 
    elif opcion == "2":
        imprimir(alumnos)
    
                    
    elif opcion == "3":
        cursos = buscar_cursos()
        print(cursos)
        
        
    elif opcion == "4":
        print("Gracias por utilizar este programa")
        break
 
    else:
        print("Opción equivocada")

#!/usr/bin/env python3

import pyautogui
import time
from pynput import mouse

# Define the positions where you want to click
positions = []

# Set the delay between clicks (in seconds)
delay = 1

# Mouse click event listener
def on_mouse_click(x, y, button, pressed):
    if pressed:
        positions.append((x, y))
        print(f"Added position: ({x}, {y})")


# Get the current mouse position and listen for clicks
def get_mouse_position():
    print('Press Ctrl-C to go on.')
    try:
        with mouse.Listener(on_click=on_mouse_click) as listener:
            listener.join()
    except KeyboardInterrupt:
        print('\nDone.')


# Autoclicker function
def autoclicker():
    print("Starting autoclicker... Press any key to exit")
    try:
        while True:
            for pos in positions:
                pyautogui.click(pos[0], pos[1])
                time.sleep(delay)
    except KeyboardInterrupt:
        print('\nAutoclicker stopped.')

def main():
    # Uncomment the function below to get the mouse position and listen for clicksget_mouse_position()
    get_mouse_position()

    positions.pop()
    print("Removed the last position.")

    # Uncomment the function below to start the autoclicker
    autoclicker()

    choice = input("Do you want to add more positions? Y/N")
    
    if(choice == 'Y' or choice == 'y'):
        main()

main()

