		dir[idx] = to_st ? make_pair(to, v) : make_pair(v, to);
		st += to_st;
		fi += to_fi;
	}
	st -= cnt[v];
	fi -= cnt[v];
	if (st && fi) {
		flag = true;
	}
	return {st, fi};
}

void solve() {
	cin >> n >> m;
	g.resize(n);
	height.resize(n);
	first.resize(n);
	used.resize(n, false);
	s.resize(n);
	f.resize(n);
	cnt.resize(n);
	dir.resize(n - 1);
	for (int i = 0; i < n - 1; i++) {
		int a, b;
		cin >> a >> b;
		a--; b--;
		g[a].push_back({b, i});
		g[b].push_back({a, i});
	}
	for (int i = 0; i < m; i++) {
		int a, b;
		cin >> a >> b;
		a--; b--;
		paths.push_back({a, b});
		s[a]++;
		f[b]++;
	}
	
	dfs(0);
	euler_n = euler.size();
	t.resize(4 * euler_n);
	build(1, 1, euler_n + 1);
	for (int i = 0; i < m; i++) {
		cnt[lca(paths[i].first, paths[i].second)]++;
	}
	used.assign(n, false);
	auto ans = dfs_2(0);
	if (flag) cout << "NO" << endl;
	else {
		cout << "YES" << endl;
		for (int i = 0; i < n - 1; i++) cout << dir[i].first + 1 << ' ' << dir[i].second + 1 << endl;
	}
}

